#
# Structure for table "hrs"
#

DROP TABLE IF EXISTS `hrs`;
CREATE TABLE `hrs` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `mid` int(11) DEFAULT NULL COMMENT '用户id',
  `username` varchar(150) DEFAULT NULL COMMENT '真实姓名',
  `intro` varchar(191) DEFAULT NULL COMMENT '说明',
  `sex` enum('female','male') DEFAULT NULL COMMENT '性别',
  `find_id` int(11) DEFAULT NULL COMMENT '分类id',
  `idcard` varchar(191) DEFAULT NULL COMMENT '身份证号码',
  `idcard_front` varchar(120) DEFAULT NULL COMMENT '身份证正面照图片地址',
  `idcard_back` varchar(120) DEFAULT NULL COMMENT '身份证背面照图片地址',
  `phone` varchar(100) DEFAULT NULL COMMENT '用户手机号',
  `read_num` int(11) DEFAULT NULL COMMENT '浏览数',
  `address` varchar(120) DEFAULT NULL COMMENT '地址',
  `is_share` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否共享:0否1是',
  `status` tinyint(4) DEFAULT NULL COMMENT '审核状态:-1=>审核拒绝,0=>待审核,1=>审核通过 (仅is_share=1时该字段有值)',
  `price` decimal(10,2) DEFAULT NULL COMMENT '价格',
  `unit` varchar(60) DEFAULT NULL COMMENT '单位',
  `work_experience` text COMMENT '工作经历',
  `complaint` varchar(255) DEFAULT NULL COMMENT '投诉',
  `reason` varchar(255) DEFAULT NULL COMMENT '拒绝原因',
  `skill_rate` varchar(191) DEFAULT NULL COMMENT '技能评分',
  `regulation_rate` text COMMENT '遵规评分分',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;

