#
# Structure for table "member_charges"
#

DROP TABLE IF EXISTS `member_charges`;
CREATE TABLE `member_charges` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `mid` int(11) NOT NULL,
  `charge_no` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '充值订单号',
  `money` decimal(10,2) NOT NULL,
  `status` tinyint(2) DEFAULT '0' COMMENT '支付状态：0未支付，1已支付',
  `pay_type` varchar(20) CHARACTER SET utf8mb4 NOT NULL,
  `pay_at` timestamp NULL DEFAULT NULL COMMENT '支付时间',
  `mark` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL,
  `pay_id` int(11) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

