#
# Structure for table "member_finances"
#

DROP TABLE IF EXISTS `member_finances`;
CREATE TABLE `member_finances` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `mid` int(11) NOT NULL,
  `money` int(10) DEFAULT '0' COMMENT '交易金额',
  `type` tinyint(2) unsigned DEFAULT '1' COMMENT '类型：1下单，2充值，3退款，4后台充值，5用户申请退款',
  `total_money` int(10) DEFAULT '0',
  `mark` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL,
  `order_id` int(11) unsigned DEFAULT '0' COMMENT '订单id：用户下单时保存',
  `order_no` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL,
  `order_type` varchar(255) DEFAULT NULL COMMENT '资源类型',
  `pay_id` int(11) DEFAULT '0' COMMENT '支付记录：充值时保存',
  `product_name` varchar(255) DEFAULT NULL COMMENT '资源名称',
  `uid` int(11) unsigned DEFAULT NULL COMMENT '管理员id',
  `refund_id` int(11) DEFAULT NULL COMMENT '退款ID',
  `created_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

